// src/components/MyComponent.js

import React, {
    useState,
    useEffect
} from 'react';
import axios from 'axios';

const MyComponent = () => {
    const [items, setItems] = useState();

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/kategori/istanbul')
            .then(response => {
                setItems(response.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);


    return ( <
        div >

        <
        h1 > Items < /h1> <
        p > {
            Object.keys(items).map(key => ( <
                span key = {
                    key
                } > {
                    key
                }: {
                    items[key]
                } < /span>
            ))
        } <
        /p>


        <
        p > {
            items
        } < /p> <
        /div>
    );
};

export default MyComponent;
